class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        subs = []
        word = list(s)
        index = 0
        
        for i in t:
            if index < len(word) and i == word[index]:
                subs.append(i)
                index +=1
        
        result = "".join(subs)
        
        return result == s
    
Solution().isSubsequence(s = "leeeeetcode", t = "")